import logo from './logo.svg';
import './App.css';
import Matrix from './matrix/Matrix';


function App() {
  var data = [{
                product_id: 1,
                data:[
                      {rowKey:"32", items:[{column:"A", value:0},{column:"B", value:1},{column:"D", value:2}]},
                      {rowKey:"34", items:[{column:"A", value:3},{column:"B", value:4},{column:"D", value:5}]},
                      {rowKey:"36", items:[{column:"A", value:6},{column:"B", value:7},{column:"D", value:8}]},
                    ] 
            },
            {
                product_id:2,
                data:[
                      {rowKey:"34", items:[{column:"C", value:0},{column:"D", value:1},{column:"DD", value:2}]},
                      {rowKey:"36", items:[{column:"D", value:3},{column:"DD", value:4},{column:"F", value:5}]},
                      {rowKey:"40", items:[{column:"DD", value:6},{column:"F", value:7},{column:"FF", value:8}]},
                      {rowKey:"42", items:[{column:"DD", value:6},{column:"F", value:7},{column:"FF", value:8}]},
                    ]
            },
]

  return (
    <div className="App">
      <div className="matrix">
        <ReactNode data={data} id ="matrix"/>
      </div>
    </div>
  );
}

export default App;
